  return(
    <div className='row'>
        <Box></Box>
        <Box></Box>
        <Box></Box>
        <Box></Box>
    </div>
  )
}

function Diagram(props){
  return(
    <div className='diagram'>
        <Row></Row>
        <Row></Row>
        <Row></Row>
        <Row></Row>
        <Row></Row>
        <Row></Row>
    </div>
  )
}

