  return (
    <div className="App">
      <header className="App-header">  
        <p>
          Heading
        </p>

      </header>
      <div className="main">
        <div className='input'></div>
        <div className='results'>Results:</div>
        <Diagram></Diagram>

      </div>
    </div>
  );
}



export default App;
